    false,nt"url": null,nt"notes": "NCEI Accession 0155648 includes physical
    and underway data collected aboard the ROGER REVELLE during cruise KNOX04RR in the
    Bay of Bengal and Indian Ocean from 2007-03-19 to 2007-05-02. These data include
    CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT
    (V). The instruments used to collect these data include ADCP and GPS. These data
    were collected by James Swift of University of California - San Diego; Scripps Institution
    of Oceanography as part of Climate Variability and Predictability (CLIVAR) I09N.
    The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NCEI as part
    of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
    the raw and automated processed data set. Post processed quality assessed data are
